import "./conversationScreen.css";
import "./usersList.css";
import { useState, useEffect } from "react";
function UsersList() {
  const [clients, setClients] = useState(false);
  const [coachs, setCoachs] = useState(false);
  const [sup, setSup] = useState(false);
  function chooseClient() {
    setClients(true);
    setCoachs(false);
    setSup(false);
    console.log(clients);
  }
  function chooseCoach() {
    setClients(false);
    setCoachs(true);
    setSup(false);
    console.log(coachs);
  }
  function chooseSup() {
    setClients(false);
    setCoachs(false);
    setSup(true);
    console.log(sup);
  }

  return (
    <div className="usersListWrapper">
      <div className="usersType">
        <div onClick={chooseClient}>
          <div className={clients ? "clicked" : "type"}>Clients</div>
        </div>
        <div className={`${coachs ? "clicked" : "type"}`} onClick={chooseCoach}>
          Coachs
        </div>
        <div className={sup ? "clicked" : "type"} onClick={chooseSup}>
          Superviseurs
        </div>
      </div>
    </div>
  );
}
export default UsersList;
